function gcd(a: number, b: number): number {
    if (b === 0) return a;
    return gcd(b, a % b);
}

function canTraverseAllPairs(nums: number[]): boolean {
    const n = nums.length;
    const parent = new Array(n).fill(0).map((_, index) => index);

    function find(x: number): number {
        if (parent[x] !== x) {
            parent[x] = find(parent[x]);
        }
        return parent[x];
    }

    function union(x: number, y: number): void {
        const rootX = find(x);
        const rootY = find(y);
        if (rootX !== rootY) {
            parent[rootX] = rootY;
        }
    }

    const primes = new Map<number, number>();
    for (let i = 0; i < n; i++) {
        let num = nums[i];
        for (let j = 2; j * j <= num; j++) {
            if (num % j === 0) {
                if (!primes.has(j)) primes.set(j, i);
                else union(i, primes.get(j)!);
                while (num % j === 0) num /= j;
            }
        }
        if (num > 1) {
            if (!primes.has(num)) primes.set(num, i);
            else union(i, primes.get(num)!);
        }
    }

    const root = find(0);
    for (let i = 1; i < n; i++) {
        if (find(i) !== root) return false;
    }
    return true;
}
